import React,{Component} from 'react';
//style importer
import * as style__ from './style';
//component importer
//utils importer
interface Props {
	formDisplayState:boolean,
	isFormDisPlay: (status: boolean) => void
}
type State = typeof initState;

const initState = {
  status: false as boolean
}
export default class SignInForm extends Component<Props,State>{
	state = initState

	formDisplay = () => {
        this.props.isFormDisPlay(!this.props.formDisplayState);
    }
    render(){
      return (
	<div style={{position:"absolute", top:"50%",left:"50%",transform:"translate(-50%,-50%)"}}>
		<form action="">
			<label htmlFor=""> CMND</label>
			<input type="text"/>
			<label htmlFor="">Password</label>
			<input type="password"/>
			<span>Bạn chưa có tài khoản ?</span>
			<span onClick={this.formDisplay}>Cancel</span>
		</form>
	</div>
	  )
    }
};
